import React from 'react';
import '../styles.css';

const Shows = () => {
  return (
    <section id="upcoming-shows" className="section">
      <h2>Upcoming Shows</h2>
      <div className="show">
        <h3>Show Title 1</h3>
        <p>Date: August 10, 2024 | Location: Theatre 1</p>
        <p>Short description of the show.</p>
        <a href="#">Learn More</a>
      </div>
      <div className="show">
        <h3>Show Title 2</h3>
        <p>Date: September 15, 2024 | Location: Theatre 2</p>
        <p>Short description of the show.</p>
        <a href="#">Learn More</a>
      </div>
    </section>
  );
}

export default Shows;
